import React from 'react'

import { HeartIcon } from '@heroicons/react/24/outline'
import Image1 from '../assets/images/Gloria Koltuk/1.jpeg'
import Image2 from '../assets/images/Gloria Koltuk/2.jpeg'
import Image3 from '../assets/images/Gloria Koltuk/3.jpeg'
import Image4 from '../assets/images/Gloria Koltuk/4.jpeg'
import Image5 from '../assets/images/Gloria Koltuk/5.jpeg'
import Image6 from '../assets/images/Gloria Koltuk/6.jpeg'
import Image7 from '../assets/images/Gloria Koltuk/7.jpeg'
import Image8 from '../assets/images/Gloria Koltuk/8.jpeg'
import Image9 from '../assets/images/Gloria Koltuk/9.jpeg'
import Image10 from '../assets/images/Gloria Koltuk/10.jpeg'
import Image11 from '../assets/images/Gloria Koltuk/11.jpeg'
import Image12 from '../assets/images/Gloria Koltuk/12.jpeg'
import Image13 from '../assets/images/WOOD KOLTUK TAKIMI han tekstil/A48A9885.jpeg'

import Image14 from '../assets/images/WOOD KOLTUK TAKIMI AFİLLİ TEKSTİL/A48A2554.jpeg'
import Image15 from '../assets/images/WOOD KOLTUK TAKIMI AFİLLİ TEKSTİL/A48A2552.jpeg'
import Image16 from '../assets/images/WOOD KOLTUK TAKIMI han tekstil/A48A9877.jpeg'
import Image17 from '../assets/images/WOOD KOLTUK TAKIMI han tekstil/A48A9874.jpeg'
import Image18 from '../assets/images/WOOD KOLTUK TAKIMI AFİLLİ TEKSTİL/A48A2557.jpeg'
import Image19 from '../assets/images/WOOD KOLTUK TAKIMI AFİLLİ TEKSTİL/A48A2574.jpeg'
import Image20 from '../assets/images/WOOD KOLTUK TAKIMI AFİLLİ TEKSTİL/A48A2574.jpeg'
import Image21 from '../assets/images/WOOD KOLTUK TAKIMI han tekstil/A48A9884.jpeg'
import Image22 from '../assets/images/WOOD KOLTUK TAKIMI han tekstil/A48A9887.jpeg'
import Image23 from '../assets/images/WOOD KOLTUK TAKIMI han tekstil/A48A9880.jpeg'
import Image24 from '../assets/images/WOOD KOLTUK TAKIMI han tekstil/A48A9892.jpeg'
import Image25 from '../assets/images/WOOD KOLTUK TAKIMI han tekstil/A48A9894.jpeg'
import Image26 from '../assets/images/WOOD KOLTUK TAKIMI han tekstil/A48A9897.jpeg'

import { configureStore, createSlice } from '@reduxjs/toolkit';
import { useDispatch } from 'react-redux';
import { motion } from 'framer-motion';
import { count } from '../store/reducers/exampleReducer';
import { Link } from 'react-router-dom';

const Article2 = () => {
  const userManagamentSlice = createSlice({
    name: "userManagament",
  });

  const store = configureStore({
    reducer: userManagamentSlice.reducer,
  });
  const dispatch = useDispatch();
  const { images, imagess, count } = useSelector((state) => state.userManagament);
  return (
    <article
      id='models'
      className='container max-lg:px-10 max-xl:px-6 gold max-md:flex max-md:flex-col relative text-2xl max-w-[1100px] my-20 m-auto w-full'
    >
      <h2 className='text-start max-lg:text-4xl max-lg:text-center text-6xl font-bold mb-10'>Modeller</h2>
      <div className="h-1 opacity-50 bg-[#FFB000]"></div>
      <div className="w-full h-full my-4 relative grid gap-5 grid-wrap grid-cols-3 max-md:grid-cols-1">
        <Link to='/article' className="flex flex-col gap-5">
          <motion.div
            initial={{ opacity: 0, scale: 0.5 }}
            animate={{ opacity: 1, scale: 1 }}
            transition={{
              duration: 0.8,
              delay: 0.5,
              ease: [0, 0.71, 0.2, 1.01]
            }}
            onClick={() => dispatch(count(0))}
